import React, { Component } from 'react';
import { Button, Paper, Typography, Link } from '@material-ui/core';
import { withStyles } from '@material-ui/styles'



const Styles = theme => ({

    paper: {
        padding: theme.spacing(1, 2),
        margin: theme.spacing(3),
        backgroundColor: '#000',
        overflowY: 'auto',
        border: '2px',
        borderStyle: 'solid',
        borderColor: '#7f7f7f',
        height: '280px',
        '&:hover': {
            borderColor: '#ffb503',

        }
    }

});

class QuestionBankPaper extends Component {
    render() {
        const { classes } = this.props;
        return (
            <Button component={Link} to ="/questionBank">
                <Paper className={classes.paper}>
                    <i className="fas fa-book" style={{ fontSize: '55px', margin: 30 }}></i>

                    <Typography variant="h6">Question Bank</Typography>
                    <br />
                    <Typography variant="overline" style={{ lineHeight: '1' }}>
                        Quickly create great looking tests using miltiple question types and formatting options.
              </Typography>
                </Paper>
            </Button>
        );
    }
}

export default withStyles(Styles)(QuestionBankPaper);
